      SELECT * FROM tab1 (FORMAT parquet) WHERE NOT - + col0 BETWEEN ( col2 ) AND + col2 / + 2 + - + 68 * + 88 * col0 + - 72;
  - name: tab1

outputs:
  - name: q8347.out
    data: |
      51	14	96
      85	5	59
      91	47	68
